		"id": 845567632086487000,
		"id_str": "845567632086487040",
		"text": "이러한 완벽주의는 일본인의 왕성한 연구욕의 바탕이 된다. 특히 이것은 외국에서는 보기 힘든 경향으로, 단순 놀이에 대해서도 연구를 하게 되는 원인이 되었다. 이러한 강박적 형에 대한 욕구는 점점 미세한 곳에 이르러 생활의 모든 면에 나타난다.",
