		"id_str": "845566958024081409",
		"text": "일본인은 형식을 중시하고, 이것은 관례의 중시와 상통한다. 미래에 비슷한 상황이 전개되었을 때 집단 구성원이 관례를 지킴에 따라 안정성을 얻을 수 있기에. 그런데 형의 중시는 강박적 경향을 낳고, 강박적 경향은 다시 일본 특유의 완벽주의를 낳는다.",
