			"text": "사실 시스템을 '계'가 아니라 '체계'로 옮기는 것에 저항을 느껴요. 한국어는 두 음절 단어가 자연스럽지만 기본적으로 '체계'는 생물-유기체적 맥락에서가 아니라 기계-무기체적 맥락에서 사용되어왔고, 그런 언어적 뉘앙스가 어휘망에 덮어씌어진 상태라서요.",
