		"text": "여기선 앞트윗과 이어질 때 '그러나'가 아닌 '그렇기에'가 되어야 한다고 봐요. 또한 '객관'은 뒷문장에서 설명하듯이, 간주관으로써 사회적 합의를 내재하고 있고, 따라서 '객관적인 정의는 언제나 그렇듯'으로.\nhttps://t.co/Q5WP20eTuO",
