			"text": "그러나 삶이라는 생체활동이 연속적인 이상(우리는 매일 노폐물의 배출 - 세포의 죽음을 경험한다) 죽음과 삶을 간단히 이분하는 것은 거의 불가능하다. 객관적으로 정의내릴 수 있을지는 몰라도, 그것은 언제나 그렇듯 미묘한 합의 하에 있을 뿐이다.",
