		"text": "아무튼 찬찬히 되새겨 보니 모에가 사어화하는 건 분명한 게, 모에풍처럼 화풍을 나타낼 때나, 외부에서 오타쿠를 비판할 때나, 다소 학술/이론적 논의에서 언급할 때를 제외하면 작품 감상이나 캐릭터 언급 등에서 빈도수가 00년대에 비해 급격히 줄었어요.",
