			"text": "꼭 그렇지만은 않다고 생각하는데, 모에체는 일본의 순정만화(소녀만화)에서 왔고 일본순정만화는 70년대엔 서구적 얼굴을 지향했음. 현재에 있어서 그러한 서구지향적 성향은 거의 남지않았다 정도만 언급하면 될 듯.\nhttps://t.co/nZcMS9SwgG",
