		"id_str": "838265768630329344",
		"text": "시대와 너무 완전히 일치하는 자들, 모든 점에서 시대와 완벽히 어울리는 자들이 동시대인인 것이 아니다. 왜냐하면 바로 그런 까닭에 그런 자들은 시대를 보는 데 이르지 못하고, 시대에 보내는 시선을 고정할 수 없기 때문이다.”",
