			"text": "명문대 출신이 지능이 높고 지식이 많을 거라는 덴 별로 반론할 이유가 없지만 그게 지성인이란 뜻은 아니다. 지성은 앎과 사고 뿐 아니라 윤리와 관계하는 개념. 단순히 생각해도 학력사회에 편승하는 노력을 기울인 사람이 학벌주의를 내면화하지 않기는 어렵다",
